import React, { Component } from "react";
import "./App.css";
import Navbar from "./components/Layout/Navbar";
class App extends Component {
  render() {
    return (
      <div className="App">
        <Navbar logo="fab fa-github" appName="Github App" />
      </div>
    );
  }
}

export default App;
